import React from 'react';
import {Container, Row, Col, ListGroup, FormControl} from 'react-bootstrap'
const fs = require('fs');

import './App.css';

fs.readFile('./clients.json', (err, data) => {
  console.log(data)
})



function SearchBar( props ){
  return(
    <div>
      <Container>
        <Row>
          <Col>
            <h3 className='mt-5'>Search</h3>
              <FormControl type='text' id='searchBox' aria-label='search box' placeholder='Search for client . . . '/>
              <ListGroup>

              </ListGroup>
          </Col>
        </Row>
      </Container>

    </div>
  )
}



function App() {
  return (
    <div className="">
      <SearchBar />
    </div>
  );
}

export default App;
